CREATE VIEW [dbo].[ADMINT_V001_USUARIOS]
 AS SELECT USU.PK_T012CODIGO, string_agg(ROL.A011NOMBRE, ', ') AS Roles, USU.A012IDENTIFICACION, USU.A012DIRECCION, USU.A012TELEFONO, USU.A012CORREO_ELECTRONICO, USU.A012ESTADO_REGISTRO, USU.A012FECHA_CREACION, 
             USU.A012FECHA_MODIFICACION, USU.A012FECHA_EXPIRACONTRASEÑA, USU.A012FECHA_FIN_CONTRATO, USU.A012FECHA_INICIO_CONTRATO, USU.A012PRIMER_NOMBRE, USU.A012SEGUNDO_NOMBRE, USU.A012SEGUNDO_APELLIDO, 
             USU.A012PRIMER_APELLIDO, USU.A012LOGIN, USU.A012CELULAR
FROM   dbo.ADMINT_T011_ROL AS ROL INNER JOIN
             dbo.ADMINT_T015_RL_USUARIO_ROL AS USU_ROL ON ROL.PK_T011CODIGO = USU_ROL.A015CODIGO_ROL RIGHT OUTER JOIN
             dbo.ADMINT_T012_USUARIO AS USU ON USU_ROL.A015CODIGO_USUARIO = USU.PK_T012CODIGO
GROUP BY USU.PK_T012CODIGO, USU.A012IDENTIFICACION, USU.A012DIRECCION, USU.A012TELEFONO, USU.A012CORREO_ELECTRONICO, USU.A012ESTADO_REGISTRO, USU.A012FECHA_CREACION, USU.A012FECHA_MODIFICACION, 
             USU.A012FECHA_EXPIRACONTRASEÑA, USU.A012FECHA_FIN_CONTRATO, USU.A012FECHA_INICIO_CONTRATO, USU.A012PRIMER_NOMBRE, USU.A012SEGUNDO_NOMBRE, USU.A012SEGUNDO_APELLIDO, USU.A012PRIMER_APELLIDO, USU.A012LOGIN, 
             USU.A012CELULAR;
GO
