/****** Object:  View [dbo].[CUPOST_V002_GESTIONPRECINTOSNACIONALES]    Script Date: 27/03/2023 11:48:59 a. m. ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
CREATE VIEW [dbo].[CUPOST_V002_GESTIONPRECINTOSNACIONALES]
AS
SELECT DISTINCT PK_T019CODIGO AS ID, A019NUMERO_RADICACION AS NUMERO_RADICADO,
                      (SELECT A001NOMBRE
                       FROM      dbo.CUPOST_T001_EMPRESA AS CU001
                       WHERE   (CUT019.A019CODIGO_EMPRESA = PK_T001CODIGO)) AS PRECINTOS_NACIONALES,
                      (SELECT A001NOMBRE
                       FROM      dbo.CUPOST_T001_EMPRESA AS CU001
                       WHERE   (CUT019.A019CODIGO_EMPRESA = PK_T001CODIGO)) AS ENTIDAD, A019FECHA_SOLICITUD AS FECHA_SOLICITUD, A019FECHA_RADICACION AS FECHA_RADICADO,
                      (SELECT A008VALOR
                       FROM      dbo.ADMINT_T008_PARAMETRICA AS T08
                       WHERE   (PK_T008CODIGO = CUT019.A019ESTADO_SOLICITUD)) AS ESTADO, A019ANALISTA_ASIGNACION AS ANALISTA, A019NUMERO_RADICACION_SALIDA AS NUMERO_RADICADO_SALIDA, 
                  A019FECHA_RADICACION_SALIDA AS FECHA_RADICADO_SALIDA
FROM     dbo.CUPOST_T019_SOLICITUDES AS CUT019
