CREATE VIEW [dbo].[CITEST_V002_SOLICITUDES] AS 
SELECT
PK_T001CODIGO AS CODIGO, 
A001CODIGO_PARAMETRICA_TIPO_PERMISO AS TIPO_PERMISO,
A001NUMERO_CERTIFICADO AS NUMERO_PERMISO, 
A001CODIGO_PARAMETRICA_TIPO_SOLICTUD AS TIPO_SOLICITUD, 
A001CODIGO_ENTIDAD_EXPORTADOR AS EXPORTADOR, 
A001CODIGO_ENTIDAD_IMPORTADOR AS IMPORTADOR,
A001FECHA_SOLICITUD AS FECHA_EMISION_PERMISO, 
A001FECHA_VENCIMIENTO AS FECHA_VENCIMIENTO,
(SELECT TOP (1) A004ESTADO_CERTIFICADO
FROM      dbo.CITEST_T004_EVALUACION AS EV
WHERE   (A004CODIGO_CERTIFICADO = CER.PK_T001CODIGO)
ORDER BY A004FECHA_CAMBIO_ESTADO DESC) AS ESTADO, 
A001OBSERVACIONES AS OBSERVACIONES
FROM     dbo.CITEST_T001_CERTIFICADO AS CER
