CREATE VIEW [dbo].[CUPOST_V001_PRECINTOSYMARQUILLAS] AS 
SELECT DISTINCT CUT019.PK_T019CODIGO AS PK_V001CODIGO,
                 (SELECT A008VALOR
                 FROM    dbo.ADMINT_T008_PARAMETRICA AS ADMINT_T008_PARAMETRICA
                 WHERE (PK_T008CODIGO = 95)) AS TIPO_DOCUMENTO, CUT001.A001NIT AS NUMERO, CUT001.A001NOMBRE AS NOMBRE, CUT019.A019NUMERO_RADICACION AS NUMERO_RADICADO, CUT019.A019NUMERO_RADICACION AS NUMERO_PERMISO_CITES, 
             CUT019.A019FECHA_CREACION AS FECHA_INICIAL, CUT019.A019FECHA_MODIFICACION AS FECHA_FINAL, CUT06.A006NUMERO_INICIAL AS NUMERO_INICIAL, CUT06.A006NUMERO_FINAL AS NUMERO_FINAL, 
             CUT027.A027NUMERO_INTERNO_INICIAL AS NUMERO_INTERNO_INICIAL, CUT027.A027NUMERO_INTERNO_FINAL AS NUMERO_INTERNO_FINAL, CUT002.A002FECHA_VIGENCIA AS VIGENCIA, CUT019.A019CANTIDAD AS CANTIDAD,
                 (SELECT A008VALOR
                 FROM    dbo.ADMINT_T008_PARAMETRICA AS ADMINT_T008_PARAMETRICA
                 WHERE (PK_T008CODIGO = CUT06.A006CODIGO_PARAMETRICA_COLOR_PRECINTOSYMARQUILLAS)) AS COLOR, A005.A005NOMBRE_CIENTIFICO AS ESPECIE,
                 (SELECT COUNT(PK_T006CODIGO) AS PRECINTOS_DISPONIBLES
                 FROM    dbo.CUPOST_T006_PRECINTOSYMARQUILLAS
                 WHERE (A006CODIGO_SOLICITUD = CUT019.PK_T019CODIGO) AND (A006ESTADO_REGISTRO = 72)) AS CUPOS_DISPONIBLES,
                 (SELECT COUNT(PK_T006CODIGO) AS PRECINTOS_DISPONIBLES
                 FROM    dbo.CUPOST_T006_PRECINTOSYMARQUILLAS AS CUPOST_T006_PRECINTOSYMARQUILLAS_1
                 WHERE (A006CODIGO_SOLICITUD = CUT019.PK_T019CODIGO) AND (A006ESTADO_REGISTRO = 73)) AS CUPOS_TOTAL
FROM   dbo.CUPOST_T019_SOLICITUDES AS CUT019 INNER JOIN
             dbo.CUPOST_T001_EMPRESA AS CUT001 ON CUT019.A019CODIGO_EMPRESA = CUT001.PK_T001CODIGO INNER JOIN
             dbo.CUPOST_T005_ESPECIEAEXPORTAR AS CUT005 ON CUT005.A005CODIGO_ESPECIE = CUT019.A019CODIGO_ESPECIEEXPORTAR INNER JOIN
             dbo.ADMINT_T012_USUARIO AS CUT0012 ON CUT0012.PK_T012CODIGO = CUT019.A019CODIGO_USUARIO_CREACION INNER JOIN
             dbo.CUPOST_T006_PRECINTOSYMARQUILLAS AS CUT06 ON CUT06.A006CODIGO_SOLICITUD = CUT019.PK_T019CODIGO INNER JOIN
             dbo.CUPOST_T002_CUPO AS CUT002 ON CUT005.A005CODIGO_CUPO = CUT002.PK_T002CODIGO INNER JOIN
             dbo.ADMINT_T005_ESPECIMEN AS A005 ON A005.PK_T005CODIGO = CUT005.A005CODIGO_ESPECIE INNER JOIN
             dbo.CUPOST_T027_NUMERACIONES_SOLICITUD AS CUT027 ON CUT027.A027CODIGO_SOLICITUD = CUT019.PK_T019CODIGO
