CREATE VIEW [dbo].[CUPOST_V003_SOLICITUDPRECINTOSNACIONALES] AS 
SELECT DISTINCT CUT019.PK_T019CODIGO AS ID, CUT019.A019ES_CONSIGNACION_GENERAR_PRECINTOS AS CONSIGNACION,
                 (SELECT A004NOMBRE
                 FROM    dbo.ADMINT_T004_CIUDAD AS A004
                 WHERE (PK_T004CODIGO = CUT001.A001CODIGO_CIUDAD)) AS CIUDAD,
                 (SELECT A003.A003NOMBRE
                 FROM    dbo.ADMINT_T004_CIUDAD AS A004 INNER JOIN
                              dbo.ADMINT_T003_DEPARTAMENTO AS A003 ON A004.A004CODIGO_DEPARTAMENTO = A003.PK_T003CODIGO
                 WHERE (A004.PK_T004CODIGO = CUT001.A001CODIGO_CIUDAD)) AS DEPARTAMENTO, CUT019.A019FECHA_SOLICITUD AS FECHA, CUT001.A001NOMBRE AS ESTABLECIMIENTO, CUT0012.A012PRIMER_NOMBRE AS PRIMER_NOMBRE, 
             CUT0012.A012SEGUNDO_NOMBRE AS SEGUNDO_NOMBRE, CUT0012.A012PRIMER_APELLIDO AS PRIMER_APELLIDO, CUT0012.A012SEGUNDO_APELLIDO AS SEGUNDO_APELLIDO,
                 (SELECT A008VALOR
                 FROM    dbo.ADMINT_T008_PARAMETRICA AS A008
                 WHERE (PK_T008CODIGO = CUT001.A001CODIGO_PERSONA_REPRESENTANTELEGAL)) AS TIPO_IDENTIFICACION, CUT0012.A012IDENTIFICACION AS NUMERO_IDENTIFICACION, CUT019.A019DIRECCION_ENTREGA AS DIRECCION_ENTREGA,
                 (SELECT A004NOMBRE
                 FROM    dbo.ADMINT_T004_CIUDAD AS A004
                 WHERE (PK_T004CODIGO = CUT019.A019CODIGO_CIUDAD)) AS CIUDAD_ENTREGA, CUT0012.A012TELEFONO AS TELEFONO, CUT0012.A012CORREO_ELECTRONICO AS CORREO_ELECTRONICO, CUT019.A019CANTIDAD AS CANTIDAD,
                 (SELECT A005NOMBRE_CIENTIFICO
                 FROM    dbo.ADMINT_T005_ESPECIMEN AS A005
                 WHERE (PK_T005CODIGO = CUT005.A005CODIGO_ESPECIE)) AS ESPECIE,
                 (SELECT PK_T005CODIGO
                 FROM    dbo.ADMINT_T005_ESPECIMEN AS A005
                 WHERE (PK_T005CODIGO = CUT005.A005CODIGO_ESPECIE)) AS CODIGO_ESPECIE, CUT0027.A027NUMERO_INTERNO_INICIAL AS CODIGO_INICIAL, CUT0027.A027NUMERO_INTERNO_FINAL AS CODIGO_FINAL, 
             CUT019.A019LONGITUD_MENOR AS LONGITUD_MENOR, CUT019.A019LONGITUD_MARYOR AS LONGITUD_MAYOR, CUT019.A019FECHA_CONSIGNACION AS FECHA_LEGAL, CUT019.A019OBSERVACIONES AS OBSERVACIONES, 
             CUT019.A019RESPUESTA AS RESPUESTA, CUT019.A019FECHA_MODIFICACION AS FECHA_DESISTIMIENTO, CUT019.A019NUMERO_RADICACION AS NUMERO_RADICACION, CUT019.A019FECHA_RADICACION AS FECHA_RADICACION, 
             CUT019.A019FECHA_CAMBIO_ESTADO_SOLICITUD AS FECHA_ESTADO, CUT019.A019OBSERVACIONES_DESISTIMIENTO AS OBSERVACIONES_DESISTIMIENTO,
                 (SELECT A012PRIMER_NOMBRE + ' ' + A012SEGUNDO_NOMBRE + ' ' + A012PRIMER_APELLIDO + ' ' + A012SEGUNDO_APELLIDO AS Expr1
                 FROM    dbo.ADMINT_T012_USUARIO AS A0012
                 WHERE (PK_T012CODIGO = CUT019.A019ANALISTA_ASIGNACION)) AS ANALISTA, CUT019.A019NUMERO_RADICACION_SALIDA AS NUMERO_RADICACION_SALIDA, CUT019.A019FECHA_RADICACION_SALIDA AS FECHA_RADICACION_SALIDA, 
             CUT019.A019VALOR_CONSIGNACION AS VALOR_CONSIGNACION
FROM   dbo.CUPOST_T019_SOLICITUDES AS CUT019 INNER JOIN
             dbo.CUPOST_T001_EMPRESA AS CUT001 ON CUT019.A019CODIGO_EMPRESA = CUT001.PK_T001CODIGO INNER JOIN
             dbo.CUPOST_T005_ESPECIEAEXPORTAR AS CUT005 ON CUT019.A019CODIGO_ESPECIEEXPORTAR = CUT005.A005CODIGO_ESPECIE INNER JOIN
             dbo.CUPOST_T002_CUPO AS CUT002 ON CUT002.PK_T002CODIGO = CUT005.A005CODIGO_CUPO INNER JOIN
             dbo.ADMINT_T012_USUARIO AS CUT0012 ON CUT0012.PK_T012CODIGO = CUT019.A019CODIGO_USUARIO_CREACION INNER JOIN
             dbo.CUPOST_T027_NUMERACIONES_SOLICITUD AS CUT0027 ON CUT019.PK_T019CODIGO = CUT0027.A027CODIGO_SOLICITUD 
