CREATE VIEW [dbo].[CITEST_V001_ANALISTAS]
AS
SELECT USUARIO.PK_T012CODIGO AS PK_V001CODIGO, USUARIO.A012PRIMER_NOMBRE AS A001PRIMER_NOMBRE, USUARIO.A012PRIMER_APELLIDO AS A001PRIMER_APELLIDO, ROL.A011DESCRIPCION AS A001DESCRIPCION, 
                  COUNT(EV.A004CODIGO_USUARIO_EVALUADOPOR) AS A001ASIGNADOS
FROM     dbo.ADMINT_T012_USUARIO AS USUARIO INNER JOIN
                  dbo.ADMINT_T015_RL_USUARIO_ROL AS RL_ROLUSUARIO ON RL_ROLUSUARIO.A015CODIGO_USUARIO = USUARIO.PK_T012CODIGO INNER JOIN
                  dbo.ADMINT_T011_ROL AS ROL ON ROL.PK_T011CODIGO IN
                      (SELECT value
                       FROM      dbo.ANALISTAS_FUNCTION(RL_ROLUSUARIO.A015CODIGO_ROL)) LEFT OUTER JOIN
                  dbo.CITEST_T004_EVALUACION AS EV ON EV.A004CODIGO_USUARIO_EVALUADOPOR = USUARIO.PK_T012CODIGO AND EV.A004ESTADO_REGISTRO = 72
WHERE  (ROL.PK_T011CODIGO IN (11, 12, 15))
GROUP BY USUARIO.PK_T012CODIGO, USUARIO.A012PRIMER_NOMBRE, USUARIO.A012PRIMER_APELLIDO, ROL.A011DESCRIPCION
