GO
CREATE VIEW [dbo].[CITEST_V005_BANDEJATRABAJOANALISTA] AS 
SELECT CI012.PK_T012CODIGO AS CODIGO_PERMISO,
                 (SELECT A008VALOR
                 FROM    dbo.ADMINT_T008_PARAMETRICA
                 WHERE (PK_T008CODIGO = CI012.A012TIPO_PERMISO)) AS TIPO_PERMISO, CI03APO.A003NOMBRES + ' ' + CI03APO.A003APELLIDOS AS NOMBRE_APODERADO, CI03APO.A003IDENTIFICACION AS IDENTIFICACION_APODERADO, 
             CI03APO.A003DIRECCION AS DIRECCION_APODERADO,
                 (SELECT AD02.A002NOMBRE
                 FROM    dbo.ADMINT_T004_CIUDAD AS AD04 INNER JOIN
                              dbo.ADMINT_T003_DEPARTAMENTO AS AD03 ON AD04.A004CODIGO_DEPARTAMENTO = AD03.PK_T003CODIGO INNER JOIN
                              dbo.ADMINT_T002_PAIS AS AD02 ON AD03.A003CODIGO_PAIS = AD02.PK_T002CODIGO
                 WHERE (AD04.PK_T004CODIGO = CI03APO.A003CODIGO_CIUDAD)) AS PAIS_APODERADO,
                 (SELECT A004NOMBRE
                 FROM    dbo.ADMINT_T004_CIUDAD
                 WHERE (PK_T004CODIGO = CI03APO.A003CODIGO_CIUDAD)) AS CIUDAD_APODERADO, CI03APO.A003TELEFONO AS TELEFONO_APODERADO, CI03APO.A003CORREO_ELECTRONICO AS CORREO_ELECTRONICO_APODERADO, 
             CI03APO.A003FAX AS FAX_APODERADO,
                 (SELECT A001NOMBRE
                 FROM    dbo.ADMINT_T001_PUERTO
                 WHERE (PK_TCODIGO = CI03APO.A003CODIGO_PUERTO_ENTRADA)) + '/' +
                 (SELECT A001NOMBRE
                 FROM    dbo.ADMINT_T001_PUERTO
                 WHERE (PK_TCODIGO = CI03APO.A003CODIGO_PUERTO_SALIDA)) AS PUERTO_SALIDA_ENTRADA_APODERADO, CI03DES.A003NOMBRES + ' ' + CI03DES.A003APELLIDOS AS NOMBRE_DESTINATARIO, 
             CI03DES.A003IDENTIFICACION AS IDENTIFICACION_DESTINATARIO, CI03DES.A003DIRECCION AS DIRECCION_DESTINATARIO,
                 (SELECT AD02.A002NOMBRE
                 FROM    dbo.ADMINT_T004_CIUDAD AS AD04 INNER JOIN
                              dbo.ADMINT_T003_DEPARTAMENTO AS AD03 ON AD04.A004CODIGO_DEPARTAMENTO = AD03.PK_T003CODIGO INNER JOIN
                              dbo.ADMINT_T002_PAIS AS AD02 ON AD03.A003CODIGO_PAIS = AD02.PK_T002CODIGO
                 WHERE (AD04.PK_T004CODIGO = CI03DES.A003CODIGO_CIUDAD)) AS PAIS_DESTINATARIO,
                 (SELECT A004NOMBRE
                 FROM    dbo.ADMINT_T004_CIUDAD
                 WHERE (PK_T004CODIGO = CI03DES.A003CODIGO_CIUDAD)) AS CIUDAD_DESTINATARIO, CI03DES.A003TELEFONO AS TELEFONO_DESTINATARIO, CI03DES.A003CORREO_ELECTRONICO AS CORREO_ELECTRONICO_DESTINATARIO, 
             CI03DES.A003FAX AS FAX_DESTINATARIO,
                 (SELECT A001NOMBRE
                 FROM    dbo.ADMINT_T001_PUERTO
                 WHERE (PK_TCODIGO = CI03DES.A003CODIGO_PUERTO_ENTRADA)) + '/' +
                 (SELECT A001NOMBRE
                 FROM    dbo.ADMINT_T001_PUERTO
                 WHERE (PK_TCODIGO = CI03DES.A003CODIGO_PUERTO_SALIDA)) AS PUERTO_SALIDA_ENTRADA_DESTINATARIO, CI03TIT.A003NOMBRES + ' ' + CI03TIT.A003APELLIDOS AS NOMBRE_TITULAR, CI03TIT.A003IDENTIFICACION AS IDENTIFICACION_TITULAR, 
             CI03TIT.A003DIRECCION AS DIRECCION_TITULAR,
                 (SELECT AD02.A002NOMBRE
                 FROM    dbo.ADMINT_T004_CIUDAD AS AD04 INNER JOIN
                              dbo.ADMINT_T003_DEPARTAMENTO AS AD03 ON AD04.A004CODIGO_DEPARTAMENTO = AD03.PK_T003CODIGO INNER JOIN
                              dbo.ADMINT_T002_PAIS AS AD02 ON AD03.A003CODIGO_PAIS = AD02.PK_T002CODIGO
                 WHERE (AD04.PK_T004CODIGO = CI03TIT.A003CODIGO_CIUDAD)) AS PAIS_TITULAR,
                 (SELECT A004NOMBRE
                 FROM    dbo.ADMINT_T004_CIUDAD
                 WHERE (PK_T004CODIGO = CI03TIT.A003CODIGO_CIUDAD)) AS CIUDAD_TITULAR, CI03TIT.A003TELEFONO AS TELEFONO_TITULAR, CI03TIT.A003CORREO_ELECTRONICO AS CORREO_ELECTRONICO_TITULAR, CI03TIT.A003FAX AS FAX_TITULAR,
                 (SELECT A001NOMBRE
                 FROM    dbo.ADMINT_T001_PUERTO
                 WHERE (PK_TCODIGO = CI03TIT.A003CODIGO_PUERTO_ENTRADA)) + '/' +
                 (SELECT A001NOMBRE
                 FROM    dbo.ADMINT_T001_PUERTO
                 WHERE (PK_TCODIGO = CI03TIT.A003CODIGO_PUERTO_SALIDA)) AS PUERTO_SALIDA_ENTRADA_TITULAR,
                 (SELECT AD04.A004NOMBRE
                 FROM    dbo.ADMINT_T001_PUERTO AS AD01 INNER JOIN
                              dbo.ADMINT_T004_CIUDAD AS AD04 ON AD01.A001CODIGO_CIUDAD = AD04.PK_T004CODIGO
                 WHERE (AD01.PK_TCODIGO = CI03DES.A003CODIGO_PUERTO_SALIDA)) AS CIUDAD_PUERTO_SALIDA,
                 (SELECT AD04.A004NOMBRE
                 FROM    dbo.ADMINT_T001_PUERTO AS AD01 INNER JOIN
                              dbo.ADMINT_T004_CIUDAD AS AD04 ON AD01.A001CODIGO_CIUDAD = AD04.PK_T004CODIGO
                 WHERE (AD01.PK_TCODIGO = CI03DES.A003CODIGO_PUERTO_ENTRADA)) AS CIUDAD_PUERTO_ENTRADA,
                 (SELECT AD02.A002NOMBRE
                 FROM    dbo.ADMINT_T004_CIUDAD AS AD04 INNER JOIN
                              dbo.ADMINT_T003_DEPARTAMENTO AS AD03 ON AD04.A004CODIGO_DEPARTAMENTO = AD03.PK_T003CODIGO INNER JOIN
                              dbo.ADMINT_T002_PAIS AS AD02 ON AD03.A003CODIGO_PAIS = AD02.PK_T002CODIGO INNER JOIN
                              dbo.ADMINT_T001_PUERTO AS AD01 ON AD01.A001CODIGO_CIUDAD = AD04.PK_T004CODIGO
                 WHERE (AD01.PK_TCODIGO = CI012.A012CODIGO_PUERTO_ENTRADA)) AS PAIS_PUERTO_ENTRADA,
                 (SELECT A008VALOR
                 FROM    dbo.ADMINT_T008_PARAMETRICA
                 WHERE (PK_T008CODIGO = AD05.A005CODIGO_TIPO_ESPECIMEN)) AS TIPO_ESPECIMEN, AD05.A005NOMBRE_CIENTIFICO AS NOMBRE_CIENTIFICO, AD05.A005NOMBRE_COMUN AS NOMBRE_COMUN, CI06.A006CANTIDAD AS CANTIDAD,
                 (SELECT A008VALOR
                 FROM    dbo.ADMINT_T008_PARAMETRICA
                 WHERE (PK_T008CODIGO = CI06.A006CODIGO_PARAMETRICA_UNIDAD_MEDIDA)) AS UNIDAD_MEDIDA, CI06.A006SEXO AS SEXO, CI06.A006CODIGO_ESPECIMEN AS CODIGO_ESPECIMEN, CI06.A006OBSERVACIONES AS OBSERVACIONES_ESPECIMEN,
                 (SELECT A008VALOR
                 FROM    dbo.ADMINT_T008_PARAMETRICA
                 WHERE (PK_T008CODIGO = CI012.A012TIPO_PAGO_PARAMETRICA)) AS TIPO_PAGO, CI03SOL.A003NOMBRES + ' ' + CI03SOL.A003APELLIDOS AS NOMBRE_SOLICITANTE, CI03SOL.A003IDENTIFICACION AS IDENTIFICACION_SOLICITANTE, 
             CI012.A012NUMERO_RADICACION AS NUMERO_RADICACION, CI012.A012FECHA_RADICACION AS FECHA_RADICACION, CI012.A012FECHA_CREACION AS FECHA_CREACION, CI012.A012FECHA_REQUERIMIENTO AS FECHA_RESPUESTA, 
             CI012.A012FECHA_APROBACION AS FECHA_ASIGNACION,
                 (SELECT A008VALOR
                 FROM    dbo.ADMINT_T008_PARAMETRICA
                 WHERE (PK_T008CODIGO = CI012.A012ESTADO_SOLICITUD)) AS ESTADO_SOLICITUD, CI012.A012OBSERVACIONES AS OBSERVACIONES, CI012.A012VALOR_CONSIGNACION AS VALOR_CONSIGNACION
FROM   dbo.CITEST_T012_SOLICITUD_PERMISOS AS CI012 INNER JOIN
             dbo.CITEST_T003_PERSONA AS CI03APO ON CI03APO.PK_T003CODIGO = CI012.A012CODIGO_APODERADO INNER JOIN
             dbo.CITEST_T003_PERSONA AS CI03DES ON CI03DES.PK_T003CODIGO = CI012.A012CODIGO_DESTINATARIO INNER JOIN
             dbo.CITEST_T003_PERSONA AS CI03TIT ON CI03TIT.PK_T003CODIGO = CI012.A012CODIGO_TITULAR INNER JOIN
             dbo.CITEST_T003_PERSONA AS CI03SOL ON CI03SOL.PK_T003CODIGO = CI012.A012USUARIO_CREACION INNER JOIN
             dbo.CITEST_T006_INFORMACIONESPECIMEN AS CI06 ON CI06.A006CODIGO_CERTIFICADO = CI012.PK_T012CODIGO INNER JOIN
             dbo.ADMINT_T005_ESPECIMEN AS AD05 ON AD05.PK_T005CODIGO = CI06.A006CODIGO_ESPECIMEN
GO
