CREATE VIEW [dbo].[CUPOST_V001_RESOLUCION_CUPOS]
AS
SELECT CUPOS.PK_T002CODIGO AS CODIGO_CUPO, CUPOS.A002NUMERO_RESOLUCION AS NUMERO_RESOLUCION, CUPOS.A002FECHA_RESOLUCION AS FECHA_RESOLUCION, 
                  CUPOS.A002FECHA_RADICADO_SOLICITUD AS FECHA_RADICADO, CUPOS.A002FECHA_PRODUCCION AS FECHA_PRODUCCION, 
                  ESPECIEEXPORTAR.A005CUPO_APROVECHAMIENTO_OTORGADOS AS CUPOS_APROVECHAMIENTO_COMERCIALIZACION, CUPOS.A002CUPOS_ASIGNADOS AS CUPOS_OTORGADOS, 
                  CUPOS.A002CUPOS_ASIGNADOS AS CUPOS_POR_AÑO, CUPOS.A002CUPOS_DISPONIBLES AS CUPOS_DISPONIBLES, CUPOS.A002CUPOS_TOTAL AS CUPOS_TOTAL, CUPOS.A002CUOTA_REPOBLACION AS CUOTA_REPOBLACION, 
                  CUPOS.A002OBSERVACIONES AS OBSERVACIONES, CUPOS.A002CODIGO_EMPRESA AS CODIGO_EMPRESA, CUPOS.A002AUTORIDAD_EMITE_RESOLUCION AS AUTORIDAD_EMITE_RESOLUCION, 
                  CUPOS.A002CODIGO_ZOOCRIADERO AS CODIGO_ZOOCRIADERO, CUPOS.A002FECHA_REGISTRO_RESOLUCION AS FECHA_REGISTRO_RESOLUCION, ESPECIEEXPORTAR.A005CODIGO_ESPECIE AS CODIGO_ESPECIE, 
                  CUPOS.A002RANGO_CODIGO_FIN AS NUMERO_INTERNO_FINAL, ESPECIEEXPORTAR.A005NUMERO_INTERNO_FINAL_CUOTA_REPOBLACION AS NUMERO_INTERNO_FINAL_CUOTA_REPOBLACION, 
                  ESPECIEEXPORTAR.A005NOMBRE_ESPECIE AS NOMBRE_ESPECIE_EXPORTAR, CUPOS.A002RANGO_CODIGO_INICIAL AS NUMERO_INTERNO_INICIAL, 
                  ESPECIEEXPORTAR.A005NUMERO_INTERNO_INICIAL_CUOTA_REPOBLACION AS NUMERO_INTERNO_INICIAL_CUOTA_REPOBLACION, 
                  ESPECIEEXPORTAR.A005CODIGO_PARAMETRICA_PAGO_CUOTA_DEREPOBLACION AS PAGO_CUOTA_REPOBLACION, EMPRESA.A001NOMBRE AS NOMBRE_EMPRESA, EMPRESA.A001NIT AS NIT_EMPRESA, 
                  EMPRESA.A001CODIGO_PARAMETRICA_TIPO_ENTIDAD AS TIPO_ENTIDAD_EMPRESA
FROM     dbo.CUPOST_T002_CUPO AS CUPOS INNER JOIN
                  dbo.CUPOST_T005_ESPECIEAEXPORTAR AS ESPECIEEXPORTAR ON ESPECIEEXPORTAR.A005CODIGO_CUPO = CUPOS.PK_T002CODIGO INNER JOIN
                  dbo.CUPOST_T001_EMPRESA AS EMPRESA ON EMPRESA.PK_T001CODIGO = CUPOS.A002CODIGO_EMPRESA
WHERE  (CUPOS.A002ESTADO_REGISTRO = 72)
