/****** Object:  View [dbo].[ADMINT_V003_USUARIO_ROL]    Script Date: 27/03/2023 11:48:59 a. m. ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
CREATE VIEW [dbo].[ADMINT_V003_USUARIO_ROL]
AS SELECT DISTINCT
	CONCAT(USU.A012PRIMER_NOMBRE,' ',
	USU.A012PRIMER_APELLIDO) NOMBRE,
	USU.A012CODIGO_PARAMETRICA_TIPOUSUARIO,
	USU.A012SEGUNDO_NOMBRE,
	USU.A012SEGUNDO_APELLIDO,
	USU.A012IDENTIFICACION,
	USU.A012CORREO_ELECTRONICO,
	RL_UR.A015CODIGO_USUARIO CODIGO_USUARIO,
	ROL.PK_T011CODIGO AS CODIGO_ROL,
	ROL.A011NOMBRE NOMBRE_ROL,
	RL_UR.PK_T0015CODIGO,
	RL_UR.A015ESTADO_SOLICITUD
FROM ADMINT_T011_ROL ROL
INNER JOIN (
SELECT
	RL.PK_T0015CODIGO,
	RL.A015ESTADO_SOLICITUD,
	RL.A015CODIGO_ROL,
	RL.A015CODIGO_USUARIO,
	VALUE AS COD
FROM ADMINT_T015_RL_USUARIO_ROL RL
CROSS APPLY STRING_SPLIT(A015CODIGO_ROL, '|')
)RL_UR ON ROL.PK_T011CODIGO=CAST(RL_UR.COD AS numeric)
INNER JOIN ADMINT_T012_USUARIO USU ON USU.PK_T012CODIGO =  RL_UR.A015CODIGO_USUARIO
GO
