                  CUT019.PK_T019CODIGO, T005.A005NOMBRE_CIENTIFICO AS NOMBRE_CIENTIFICO, T005.PK_T005CODIGO AS ID, T005.A005NOMBRE_COMUN AS NOMBRE_COMUN, CUT001.A001NIT AS NIT, 
                  CUT002.A002CUPOS_ASIGNADOS AS CUPOS, CUT002.A002CUPOS_TOTAL AS SALDO, CUT002.A002FECHA_VIGENCIA AS VIGENCIA, CUT002.A002_NUMERACION_INICIAL_PRECINTOS AS NUMERACION_INICIAL_PRECINTOS, 
                  CUT002.A002_NUMERACION_FINAL_PRECINTOS AS NUMERACION_FINAL_PRECINTOS, CUT002.A002RANGO_CODIGO_INICIAL AS NUMERACION_INICIAL_MARQUILLA, 
                  CUT002.A002RANGO_CODIGO_FIN AS NUMERACION_FINAL_MARQUILLA
