                  dbo.CUPOST_T001_EMPRESA.A001CODIGO_PARAMETRICA_TIPO_ENTIDAD AS ESTADO, dbo.CUPOST_T002_CUPO.A002ESTADO_REGISTRO AS ESTADO_CITES, 
