                  dbo.CUPOST_T005_ESPECIEAEXPORTAR.A005CODIGO_ESPECIE AS CODIGO_ESPECIE, dbo.CUPOST_T005_ESPECIEAEXPORTAR.A005POBLACION_PARENTAL_MACHO AS POBLACION_MACHO, 
                  dbo.CUPOST_T005_ESPECIEAEXPORTAR.A005POBLACION_PARENTAL_HEMBRA AS POBLACION_HEMBRA, dbo.CUPOST_T005_ESPECIEAEXPORTAR.A005POBLACION_PARENTAL_TOTAL AS POBLACION_TOTAL, 
                  dbo.CUPOST_T005_ESPECIEAEXPORTAR.A005AÑO_PRODUCCION AS ANIO_PRODUCCION, dbo.CUPOST_T005_ESPECIEAEXPORTAR.A005POBLACION_DISPONIBLE_PARA_CUPOS AS CUPOS_COMERCIALIZACION, 
